import OriginMenu from "./OriginMenu";
import Folders from "./Folders";

const FoldersMainContent = (props) => {
  if (props.content == "") {
    return <OriginMenu />;
  } else if (
    props.content ==
    "Obywatele UE (oraz EOG/Szwajcarii) i członkowie ich rodzin"
  ) {
    return <Folders id="obywatele_ue" />;
  } else if (props.content == "Obywatele państw trzecich") {
    return <Folders id="obywatele_pt" />;
  } else if (props.content == "Obywatele Wielkiej Brytanii (Brexit)") {
    return <Folders id="obywatele_wb" />;
  }
};

export default FoldersMainContent;
